import React, { useEffect } from 'react';
import App from './../app/App.jsx';
import axios from 'axios';
import { useDispatch } from 'react-redux';
import { fetchPosts } from './../Actions/index.jsx';

function AppContainer(){
  const dispatch = useDispatch();

  const getListMessagePopup = async () => {
    await axios.get('/api/auth/list-message')
    .then((res) => {
        // console.log(res);
    }).catch((e) => {
      // console.log(e);
    })
  }

  const getPostsNewFeed = async () => {
    await axios.get('/api/auth/get-post-home?page=1').then((res) => {
      console.log(res);
      dispatch(fetchPosts(res.data.data))
    }).catch((err) => {
      console.log(err);
    })
  }

  useEffect(() => {
    getPostsNewFeed()
    getListMessagePopup()
  },[])

  return(
    <App />
  )
}

export default AppContainer;
